import { Button } from "@mui/material";
import React from "react";
import pic from "./img/bg.png";
import pic2 from "./img/pic2.png";

const Landing = () => {
  return (
    <>
      {" "}
      <div className="">
        <h1 className="m-2 max-w-lg text-2xl font-bold ml-60 mt-6 md:text-4xl md:text-left ">
          <span>PLACEMENT PORTAL</span>
        </h1>
        <div className="flex">
          <div className="">
            <img src={pic} class="object-cover min w-900px" />
          </div>{" "}
          <div className="h-400px w-320px bg-[#DDE8FE] flex flex-col gap-10 ml-40 rounded-md shadow-lg shadow-500/40">
            <Button
              variant="outlined"
              color="secondary"
              style={{ marginTop: "30px", Padding: "4px" }}
            >
              Secondary
            </Button>
            <Button variant="outlined" color="secondary">
              Secondary
            </Button>
            <Button variant="outlined" color="secondary">
              Secondary
            </Button>
            <h1 className="text-center text-xl">Not Signed Yup yet ?</h1>
            <Button variant="outlined" color="secondary">
              Secondary
            </Button>
            <div className="flex flex-col ">
              <h1 className="text-xl text-center">Download the App </h1>
              <img className="h-30 w-48 text-center" src={pic2} />
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Landing;
